import React from 'react';
import ReactDOM from 'react-dom';
import Button from 'react-bootstrap/Button';
import ButtonToolbar from 'react-bootstrap/ButtonToolbar';
import './Botton.css';
function button(props) {
  return (
    <div>
    <head>
<script src="https://unpkg.com/react/umd/react.production.js" crossorigin />

<script
  src="https://unpkg.com/react-dom/umd/react-dom.production.js"
  crossorigin
/>

<script
  src="https://unpkg.com/react-bootstrap@next/dist/react-bootstrap.min.js"
  crossorigin
/>

<script>var Alert = ReactBootstrap.Alert;</script>
</head>
  <ButtonToolbar>
  <Button className="btn-flat">Primary</Button>
  <Button className="btn-flat">Secondary</Button>
  <Button className="btn-flat">Success</Button>
  <Button className="btn-flat">Warning</Button>
  <Button className="btn-flat">Danger</Button>
  <Button variant="outline-info">Info</Button>
  <Button variant="outline-light">Light</Button>
  <Button variant="outline-dark">Dark</Button>
</ButtonToolbar>
      </div>
  );
}
class Buttons extends React.Component {
  renderButton(i,val) {
    return (
      <button
        val={val}
        onClick={() => this.props.onClick(i)}
      />
    );
  }

  render() {
    return (
    <div>
      <div>
      {this.renderButton(0,this.props.buttons[0])}
      </div>
       <div>
      {this.renderButton(1,this.props.buttons[1])}
      </div>
       <div>
      {this.renderButton(2,this.props.buttons[2])}
      </div>
       <div>
      {this.renderButton(3,this.props.buttons[3])}
      </div>
      </div>
    );
  }
}
export default Buttons;
